<script type="text/javascript">
const rotatingWordsHandler = ( target ) => {
let ticker = 0;
const parent = document.querySelector( target ),
words = document.querySelectorAll( `${ target } b` );
setInterval( () => {
for ( let i = 0; i < words.length; i++ ) {
const word = words[ i ],
first = 0,
next = i + 1;
if ( next === words.length ) {
const firstWidth = words[ first ].offsetWidth;
word.classList.remove( 'is-showing' );
words[ first ].classList.add( 'is-showing' );
parent.style.width = `${ firstWidth }px`;
break;
}
if ( word.classList.contains( 'is-showing' ) ) {
const nextWidth = words[ next ].offsetWidth;
word.classList.remove( 'is-showing' );
word.classList.add( 'is-hiding' );
words[ next ].classList.add( 'is-showing' );
parent.style.width = `${ nextWidth }px`;
break;
}
}
parent.classList.remove( 'is-loading' )
ticker = setTimeout( () => parent.classList.add( 'is-loading' ), 600 );
ticker;
}, 2500 );
}
rotatingWordsHandler( '.rotating-words' );
